import "./App.css";
import AsherSignature from "./Images/AsherSignature.png";

function App() {
  return (
    <div className="App">
      <div>
        <img src={AsherSignature} className="App-logo" alt="signature" />
      </div>
      <div>
        <h1 className="imageText">
          This website is currently under construction, please come back soon!
        </h1>
      </div>
    </div>
  );
}

export default App;
